import React, { useEffect,useState } from 'react';

export default function TimerExample() {
    const [counttime,setCount]=useState(0)

    useEffect(()=>{
        setTimeout(()=>{
            setCount((count)=> count + 1)
        },1000)
    })
    return (
        <div>
            <h1>Set TimeOUT</h1>
            <h1>Start CountDOWN {counttime}</h1>
        </div>
    )
}
